CKEDITOR.plugins.setLang("a11yhelp","vi",{title:"Accessibility Instructions",contents:"N\u1ed9i dung H\u1ed7 tr\u1ee3. Nh\u1ea5n ESC \u0111\u1ec3 \u0111\xf3ng h\u1ed9p tho\u1ea1i.",legend:[{name:"Chung",items:[{name:"Thanh c\xf4ng c\u1ee5 so\u1ea1n th",legend:"Nh\u1ea5n ${toolbarFocus} \u0111\u1ec3 \u0111i\u1ec1u h\u01b0\u1edbng \u0111\u1ebfn thanh c\xf4ng c\u1ee5. Nh\u1ea5n TAB v\xe0 SHIFT-TAB \u0111\u1ec3 chuy\u1ec3n \u0111\u1ebfn nh\xf3m thanh c\xf4ng c\u1ee5 kh\xe1c. Nh\u1ea5n M\u0168I T\xcaN PH\u1ea2I ho\u1eb7c M\u0168I T\xcaN TR\xc1I \u0111\u1ec3 chuy\u1ec3n sang n\xfat kh\xe1c tr\xean thanh c\xf4ng c\u1ee5. Nh\u1ea5n PH\xcdM C\xc1CH ho\u1eb7c ENTER \u0111\u1ec3 k\xedch ho\u1ea1t n\xfat tr\xean thanh c\xf4ng c."},{name:"H\u1ed9p tho\u1ea1i Bi\xean t",legend:"Inside a dialog, press TAB to navigate to next dialog field, press SHIFT + TAB to move to previous field, press ENTER to submit dialog, press ESC to cancel dialog. For dialogs that have multiple tab pages, press ALT + F10 to navigate to tab-list. Then move to next tab with TAB OR RIGTH ARROW. Move to previous tab with SHIFT + TAB or LEFT ARROW. Press SPACE or ENTER to select the tab page."},{name:"Tr\xecnh \u0111\u01a1n Ng\u1eef c\u1ea3nh cB\u1ed9 so\u1ea1n th\u1ea3o",legend:"Press ${contextMenu} or APPLICATION KEY to open context-menu. Then move to next menu option with TAB or DOWN ARROW. Move to previous option with SHIFT+TAB or UP ARROW. Press SPACE or ENTER to select the menu option. Open sub-menu of current option with SPACE or ENTER or RIGHT ARROW. Go back to parent menu item with ESC or LEFT ARROW. Close context menu with ESC."},{name:"Editor List Box",legend:"Inside a list-box, move to next list item with TAB OR DOWN ARROW. Move to previous list item with SHIFT + TAB or UP ARROW. Press SPACE or ENTER to select the list option. Press ESC to close the list-box."},{name:"Editor Element Path Bar",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with  SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"Commands",items:[{name:" Undo command",legend:"Press ${undo}"},{name:" Redo command",legend:"Press ${redo}"},{name:" Bold command",legend:"Press ${bold}"},{name:" Italic command",legend:"Press ${italic}"},{name:" Underline command",legend:"Press ${underline}"},{name:" Link command",legend:"Nh\u1ea5n ${link}"},{name:" Toolbar Collapse command",legend:"Nh\u1ea5n${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Accessibility Help",legend:"Nh\u1ea5n ${a11yHelp}"}]}]});